%[text] %[text:anchor:T_9ECBD2CF] # Segment by Texture
%[text] Texture is a defining characteristic of many images. Think of properties like smooth and rough. If you consider intensity as a surface plot, where higher intensities are taller and lower intensities are shorter, then a rough surface would have more hills and valleys than a smooth surface. When we analyze texture, we look at the variation of these intensities. You can measure variation using standard deviation, range, or entropy.
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] %[text:anchor:H_EBD69111] ## Visualizing Texture
%[text] We can think of texture like the surface of an image. 
%[text] %[text:anchor:H_3119EF72] ### Surface Plot
%[text] Consider the following image:
clearvars
close all
clc
mmSetUnitDataFolder(2);
sted_crop = imread("Atto590_sted_crop.tif");

% display
figure;
imshow(sted_crop,parula(50))
%[text] - Think of that bright yellow circle as a mountain peak with some foothills surrounding it \
%[text] 
%%
%[text] %[text:anchor:H_2756E03C] ### Create a 3D version of the image
%[text] We can visualize this image as 3D landscape, plotting intensity as height. 
%[text] In this example, we will create a gridded data version of the image using the function **meshgrid.** Here, intensity is plotted as if it were a height in the image, along the z-axis.
figure(Visible="on");
tiledlayout("horizontal")
ax1 = nexttile;

[X,Y] = meshgrid(1:size(sted_crop,2), 1:size(sted_crop,1));

% use intensity as magnitude data for the Z coordinates
surf(X,Y,sted_crop,'EdgeAlpha',0.25);
axis image
title('3D representation of intensity')
xlabel('x position'); ylabel('y position'); zlabel("pixel intensity")
%[text] - rotate the 3D view to visualize the dot in 3D.
%[text] - Notice that brighter spot turned into a mountain peak and the dimmer spot is like a foothill
%[text] - Can you rotate the image so that it looks like original 2D image? \
%%
%[text] %[text:anchor:H_66D5A7C0] ## Enhance
%[text] What happens to our mountain peak when we enhance? Here, we use  **imadjust** to enhance the image by stretching out the histogram. We use the function **linkprop** to sync the view between the two plots. 
ax2 = nexttile;
p = surf(X,Y,imadjust(sted_crop),'EdgeAlpha',0.25);
axis image
title('imadjust of sted dot')

% link subplots
ax2.View = ax1.View;
hlink = linkprop([ax1,ax2],{'CameraPosition','CameraUpVector'});
rotate3d on
%[text] - After **imadjust**, the intensity of all pixels has increased
%[text] - But, we have also increased the noise level and now the brightest dot has many saturated pixels
%[text] - So, use the function **imadjust** wisely.  \
%[text] 
%%
%[text] %[text:anchor:H_36607569] ### Compare Spatial Filters
%[text] How do spatial filters affect the image? 
%[text] In this example, we use multiple filters on the image and then display, using the local function [**plot\_3D\_comp**](internal:M_DB7E22D4)**.** Notice that the 2nd input into plot\_3D\_comp is a cell array. We also calculate the signal to noise ratio for each filtered image, using the function **psnr** (review the plot\_3D\_comp function for more details on the syntax)
avg_filt = fspecial("average",[3 3]); % create average filter
sted_avg = imfilter(sted_crop,avg_filt,"symmetric"); % average the image

sted_med = medfilt3(sted_crop); % median filter
sted_gau = imgaussfilt(sted_crop,1); % what happens if you adjust sigma?

plot_3D_comp(sted_crop,{sted_avg, sted_med,sted_gau}, ["average","median","gaussian"]);

function hlink = plot_3D_comp(img, imgfs,ttls) %[text:anchor:M_DB7E22D4]
figure('Visible','on');
warning('off', 'all');

axs = gobjects(numel(imgfs)+1);

axs(1) = nexttile;
[X,Y] = meshgrid(1:size(img,2), 1:size(img,1));
surf(X,Y,img,'EdgeAlpha',0.25)  % plot original
axis image
zlim([0 40])
% set(axs(1), 'ZLim', [0 40])

for n=1:numel(imgfs)
    imgf = imgfs{n};
    [~,snr] = psnr(imgf,img); % calculate signal-to-noise 
    axs(n+1) = nexttile;

    surf(X,Y,imgf,'EdgeAlpha',0.25)
    axis image
    title(sprintf('%s, snr = %1.2f',ttls(n), snr))
    zlim([0 40])
end

hlink = linkprop(axs,{'CameraPosition','CameraUpVector'});
warning('on', 'all');

end
%[text] - The signal-to-noise ratio is slightly higher for the gaussian blur \
%[text] 
%%
%[text] %[text:anchor:H_4A78FEE1] ### Gaussian Filter
%[text] %[text:anchor:H_416D3453] What happens if you adjust sigma?
%[text] Sigma determines the standard deviation of the smoothing kernel used in the gaussian filter. The following is a comparison of the gaussian filter with several different sigma values. We will also calculate the Point Spread Function to see which alpha is best
figure('Visible',"on","Name","Sigma Comparison",ToolBar="figure")
nexttile
[X,Y] = meshgrid(1:size(sted_crop,2), 1:size(sted_crop,1));
surf(X,Y,sted_crop,'EdgeAlpha',0.25)
axis image
zlim([0 40])
ha = gca;
title('unmodifid')

sigmas = [0.5 1 2 4 8];

for n=1:numel(sigmas)
    nexttile
    sted_avg = imgaussfilt(sted_crop,sigmas(n)); % what happens if you adjust sigma?
    surf(X,Y,sted_avg,'EdgeAlpha',0.25)
    axis image
    zlim([0 40])

    [~,snr] = psnr(sted_avg,sted_crop);

    title(sprintf('\\sigma: %1.1f, SNR: %1.2f',sigmas(n),snr))
    ha = [ha gca];
end
hlink = linkprop(ha,{'CameraPosition','CameraUpVector'});
% rotate3d on
%[text] - Larger SNR are better, so continuing to modify the image reduces the signal to noise ratio \
%%
%[text] %[text:anchor:H_27231013] ## Texture for Segmentation
%[text] So, how do we estimate texture for images? And how can we use that to segment images. 
%[text] Consider the following two images:
clearvars
clc
mmSetUnitDataFolder(2);
img1 = imread("smoothBark.png");
img2 = imread("roughBark.png");

figure;
tiledlayout(1,2,'TileSpacing','tight')
nexttile; imshow(img1); title('smooth')
nexttile; imshow(img2); title('rough')
%[text] - Visually, its easy see to the texture difference
%[text] - But how do we compare these differences computationally? \
%%
%[text] %[text:anchor:H_B4C72DB3] ### Display Image as a surface
figure(Visible="on")
ax=[];
ax(1) = nexttile;
img1 = im2gray(img1);
[X,Y] = meshgrid(1:size(img1,2), 1:size(img1,1));
surf(X,Y,img1);
zlim([0 300])


ax(2) = nexttile;
img2 = im2gray(img2);
[X,Y] = meshgrid(1:size(img2,2), 1:size(img2,1));
surf(X,Y,img2);
zlim([0 300])
hlink = linkprop(ax,{'CameraPosition','CameraUpVector'});
%[text] - Clearly, the second image has more variance.
%[text] - But this is a bit complicated to visualize across all dimensions \
%%
%[text] %[text:anchor:H_B62FD04C] ### Line Profiles
%[text] Here we use a line profile to simplify the analysis
%[text] Line profiles are intensity plots along a line in an image. Let's grab the middle row of intensity from each image and plot as a line plot
img1g = im2gray(img1); % convert to grayscale
img2g = im2gray(img2);

lp1 = img1g(101,:); % 101st row, all columns
lp2 = img2g(101,:);

mask = false(size(img1g)); % create a mask with trues along the 101st row
mask(101,:) = true;
I1 = imoverlay(img1,mask, 'cyan'); % burn mask into images
I2 = imoverlay(img2,mask,'magenta');

figure;
tiledlayout(1,3,"Padding","tight")

nexttile
imshow(I1);

nexttile
imshow(I2)

nexttile
plot(lp1,'c');
hold on
plot(lp2,'m')
legend('smooth','rough','Location','bestoutside')
grid on
axis image
%[text] - This is a little easier to understand
%[text] - the rough image clearly has more variation in intensity as you move across the image \
%%
%[text] %[text:anchor:H_951CEB66] ### Measurements of Texture
%[text] Which line profile has a larger standard deviation? We can create a texture profile by comparing a pixel to its neighbor. 
%[text] Here, we calculate a moving standard deviation of the line profile. The function **movstd** calculates standard deviation over a sliding window of length 5 (second input) across neighboring elements of the line profile.
lp1STD = movstd(single(lp1),5);
lp2STD = movstd(single(lp2),5);

clf
nexttile

lp1STD = movstd(single(lp1),5);
lp2STD = movstd(single(lp2),5);

plot(lp1STD,'c');
hold on
plot(lp2STD,'m')
legend('smooth','rough','Location','bestoutside')
grid on
ylabel('Moving Standard deviation')
%[text] - The standard deviation is higher in the rough image \
%%
%[text] %[text:anchor:H_65FAF5D6] ## Types of  Texture Filters
%[text] There are three main types of texture filters we can use on images:
%[text] - **range filter**: replaces pixel with range of the Neighborhood
%[text] - **standard deviation filter**: replaces pixel with the standard deviation of the Neighborhood
%[text] - **entropy filter:** replaces pixel with entropy of the Neighborhood. Entropy is a measurement of randomness \
%[text] ![](text:image:3d9a)
%[text] ![](text:image:2e8e)
%[text] ![](text:image:08a9)
%[text] Each of them look at a neighborhood around each pixel and replaces that pixel with a measure of the texture around it.
%%
%[text] %[text:anchor:H_9BAFD770] ## Example: Flat Fish 
%[text] %[text:anchor:H_82360028] ### Load the fish
%[text] I have store a file called flatfish.jpg in the data folder of the Unit 2 directory. 
clearvars
close all
clc
mmSetUnitDataFolder(2)
p.name = "flatfish";
p.rgb = imread("flatfish.jpg");
figure
imshow(p.rgb)
%[text] - this would be difficult to segment by color, since the flatfish is camouflaged to match its surroundings
%[text] - However, the dots in the fish look a little larger than the dots in the sand surrounding the fish
%[text] - Is there a difference in texture?
%[text] - Let's try some texture filters \
%%
%[text] %[text:anchor:H_A5E2CDB6] ### Convert to grayscale
%[text] Texture filters typically require converting the image to a grayscale first. 
p.gray = im2gray(p.rgb);
imshow(p.gray)
%%
%[text] %[text:anchor:H_57B0ED9F] ### Standard deviation filter
%[text] The function **stdfilt** applies a 2D filter to the image
p.std = stdfilt(p.gray); % returns a double
p.std = rescale(p.std); % rescale because stdfilt returns a double

imshow(p.std,[])
%[text] - The texture image has noticeably greater contrast than the original image \
%[text] 
%%
%[text] %[text:anchor:H_E076499C] ### Range Filter
%[text] Now you try. Use the **rangefilt** function to filter the gray image and save as **p.rng**.  You don't need to rescale the filtered image. Display the filtered image

%[text] - returns same class — doesn't need to be rescaled \
%%
%[text] %[text:anchor:H_D19A515A] ### Entropy Filter
%[text] Apply an entropy filter to the grayscale image using the **entropyfilt** function  and save as ***p.ent***. Rescale the image and display. 

%%
%[text] %[text:anchor:H_A52AD608] ### Display all results
%[text] Here we use **mmShowStruct**, with a couple of inputs to display a select set of the structure fields
figure;
tiledlayout("flow",TileSpacing="tight",Padding="tight")
mmShowStruct(p,"fn2display",["rgb" "std" "rng" "ent"])
%%
%[text] %[text:anchor:H_1365A1FA] ### Standard deviation for the win
%[text] Looks like we got the best result using the standard deviation filter. Let's try to binarize that image. Since the fish is dark, we should first complement the image. Assign to ***p.complement***. Then binarize and assign to ***p.mask***. And then display the results
p.complement = imcomplement(p.std);
p.mask = imbinarize(p.complement);
figure
imshow(p.mask)
%[text] - hmm, a little messy \
%%
%[text] %[text:anchor:H_7A5B71A7] ### Does filtering help?
%[text] - Apply a median filter to the ***p.std*** image assign to ***p.stdf***.  \
%[text] Then repeat the steps above to binarize.
p.stdf = [];
p.complement = imcomplement(p.stdf)
p.mask = imbinarize(p.complement);
imshow(p.mask)
%[text] - a little better \
%%
%[text] What about a gaussian filter? Repeat the same steps using **imgaussfilt** with a sigma setting of 3. Assign to ***p.stdf***. Display the results

p.complement = imcomplement(p.stdf)
p.mask = imbinarize(p.complement);
imshow(p.mask)
%[text] - now we're getting somewhere \
%%
%[text] %[text:anchor:H_0966] #### Clean up the mask
%[text] Use morphological operations on `p.mask` to: 
%[text] 1. Clear border
%[text] 2. Fill holes
%[text] 3. Clean up small noise (smaller than 3000)
%[text] 4. Display pseudocolor overlay to track progress \
% clear border
% fill holes
% clean up small noise
imshowpair(p.rgb, p.mask)
%[text] ### 
%%
%[text] %[text:anchor:H_3ab8] #### Burn the mask on the RGB image
mmShowBurnImage(p.rgb,p.mask)
%%
%[text] %[text:anchor:H_0e3b] #### Create an outline of the mask and display
outline = boundarymask(p.mask); % create outline
mmShowBurnImage(p.rgb, outline,color='magenta') % burn outline on image
%[text] - pretty, pretty good \
%%
%[text] %[text:anchor:H_743A04F7] ## Example: Zebra
%[text] Consider the following image
clearvars
close all
clc

mmSetUnitDataFolder(2)
p.name = "zebras.png";
p.rgb = imread(p.name);
p.gray = im2gray(p.rgb);

figure;
imshow(p.gray)
%[text] An area with stripes has pixels with both small and large intensities—this can be considered a type of texture.
%[text] So zebras can be detected with a range filter, which looks at the range of intensities in a neighborhood
%[text] The size of the neighborhood is important. By default, `rangefilt` uses a 3-by-3 neighborhood, but you can specify a different neighborhood. If it is too small (yellow box), the filter will fit within the stripes and won't pick up the variation. If the neighborhood is too large (orange box), areas with mostly grass will be marked as having the same range of intensities as the zebra stripes. Here, you will get an over-segmentation
%[text] ![](text:image:23c2)
%[text] ![](text:image:6579)
%%
%[text] %[text:anchor:H_9163C740] ### Range Filter
p.rng = rangefilt(p.gray);
clf
imshow(p.rng)
%[text] The function **rangefilter** as a default 3-by-3 neighborhood, which in this case a bit too small. You can see some dark spots in the zebras where the neighborhood was completely contained within a stripe and did not detect variation.
%%
%[text] %[text:anchor:H_661946D4] ### Roll your own neighborhood
%[text] You can create an *n*-by-*n* neighborhood with the \*\*`true`\*\*function.
nHood = true(15)
%%
%[text] %[text:anchor:H_23229C58] ### Range filter of zebra image with larger neighborhood
p.rng = rangefilt(p.gray, nHood);
imshow(p.rng)
%[text] A 15-by-15 neighborhood was too large. You can see that the bright areas identifying the zebras are too clunky. This would result in an over-segmentation.
%%
%[text] %[text:anchor:H_629A2080] ### Range filter with a smaller neighborhood
%[text] Use the range filter on the zebras image with a 7X7 neighborhood. Assign the filtered image to ***p.rng*** and display

imshow(p.rng)
%%
%[text] %[text:anchor:H_5DC0A788] ### Segment the zebras
%[text] - Binarize the filtered image and save as ***p.mask***.
%[text] - Overlay the mask on the original zebras image.  \

imshowpair(p.gray, p.mask)
%%

%%
mmShowBurnImage(p.gray, p.mask)
%[text] - notice we have noise at the bottom of the image. Perhaps `imclearborder` would fix that? \
%%
%[text] %[text:anchor:H_61136777] ### Try other sized filters
%[text] %[text:anchor:H_772C1589] #### Rectangular
% rectangular NBHD
nHood = true(7,15);
p.rng = rangefilt(p.gray, nHood);
p.mask = imbinarize(p.rng);
mmShowBurnImage(p.gray,p.mask)
%%
%[text] %[text:anchor:H_11EAC797] ####  X-shaped NBHD with true and false values
nHood = true(3);
nHood([2 4 6 8]) = false

p.rng = rangefilt(p.gray, nHood);
p.mask = imbinarize(p.rng);
clf
mmShowBurnImage(p.gray,p.mask)
%%
%[text] %[text:anchor:H_4CCA6BB6] ## Example: Snow Ferret
clearvars
close all
clc
mmSetUnitDataFolder(2)
p.name ="snow.png"
p.rgb = imread(p.name);
imshow(p.rgb)
%%
%[text] %[text:anchor:H_AA8E6E83] ### Convert to grayscale
%[text] Convert p.***rgb*** to a grayscale image and save as p.***gray***. Display the result

%%
%[text] %[text:anchor:H_17897B6C] ### Standard Deviation
%[text] - Apply a standard deviation filter to ***p.gray*** with a 19x19 neighborhood.
%[text] - Save as ***p.std***.
%[text] - Rescale and display. \

%%
%[text] %[text:anchor:H_DB208608] ### Range Filter
%[text] - Apply a rangefilter to ***p.gray*** with 19x19 neighborhood.
%[text] - Save as ***p.rng*** and display (no need to rescale). \

%%
%[text] %[text:anchor:H_87E407B5] ### Entropy filter
%[text] - Apply an entropy filter with a 19x19 neighborhood.
%[text] - Save as ***p.ent***.
%[text] - Rescale and display. \

%%
%[text] ### Review the results
figure
mmShowStruct(p)
%%
%[text] %[text:anchor:H_14520837] ### Segment the ferret
%[text] Looks like the entropy filter best captured the ferret. 
%[text] - Use a median filter on `p.ent` with a `7x7` neighborhood. NOTE: for the **medfilt2** function, you indicate the neighborhood as a vector: \[7,7\].
%[text] -     Save as ***p.entf***.
%[text] - Binarize **p.entf** and save as **p.mask**.
%[text] - Clean up the mask by removing small, connected pixels smaller than 1000. Fill any holes.
%[text] - Display your results as an overlay the mask on the original snow image . \
%[text] 

%%
%[text] ### Burn Mask on original image
figure
mmShowBurnImage(p.rgb,p.mask)
%%
%[text] ## Course Function to review textures
%[text] The course function `mmGetTextureFilters` automatically applies the texture filters to the an image
clearvars
p.name ="snow.png"
p.rgb = imread(p.name);

p=mmGetTextureFilters(p)
figure
mmShowStruct(p)

